@Component({
  template: `<router-outlet></router-outlet>`,
})
export class OrdersComponent {
}

@Component({
  templateUrl: './new-order.component.html',
  styleUrls: ['./orders.component.css']
})
export class NewOrderComponent {
}

@Component({
  templateUrl: './order-list.component.html',
  styleUrls: ['./orders.component.css']
})
export class OrderListComponent {
}
<nav class="navbar navbar-expand-sm navbar-toggleable-sm navbar-light bg-white border-bottom box-shadow mb-3">
  <div class="container">
    <h5 class="navbar-brand">New Order</h5>
  </div>
</nav>
<nav class="navbar navbar-expand-sm navbar-toggleable-sm navbar-light bg-white border-bottom box-shadow mb-3">

  <div class="container">
    <div class="navbar-collapse collapse d-sm-inline-flex justify-content-end">
      <ul class="navbar-nav flex-grow">
        <li class="nav-item" [routerLinkActive]="['link-active']">
          <a class="nav-link text-dark" [routerLink]="['../list']">Back</a>
        </li>
        <li class="nav-item" [routerLinkActive]="['link-active']">
          <a class="nav-link text-dark" [routerLink]="['../list']">Submit</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
<nav class="navbar navbar-expand-sm navbar-toggleable-sm navbar-light bg-white border-bottom box-shadow mb-3">
  <div class="container">
    <h5 class="navbar-brand">Orders</h5>
    <div class="navbar-collapse collapse d-sm-inline-flex justify-content-end">
      <ul class="navbar-nav flex-grow">
        <li class="nav-item" [routerLinkActive]="['link-active']">
          <a class="nav-link text-dark" [routerLink]="['../new']">New Order</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
